//npm start
import React from 'react';
import img_main from '../../images/img_main.jpg';
import MainCss from './Main.module.css';
import MyPost from './components/Main/MyPost/Main';


const Main = () => {
    return (
        <React.Fragment>
            <main className={MainCss.main}>
                <div>
                    <img src={img_main} alt="Картинка2" height="150" />
                </div>
                <div>ava+description</div>
                <MyPost />
                <div>new post</div>
                Main content
            </main>
        </React.Fragment>
    );
}

export default Main;
